tables.table_schema:
CREATE TABLE market_research_data (
  id UUID PRIMARY KEY,
  data JSONB
);

CREATE TABLE customer_feedback (
  id UUID PRIMARY KEY,
  feedback_text TEXT,
  rating INT
);

CREATE TABLE Customer_Feedback (
    id INT PRIMARY KEY,
    feedback_date DATE,
    customer_name VARCHAR(100),
    feedback_text TEXT
);

CREATE TABLE MarketResearchData (
  id INT PRIMARY KEY,
  research_topic TEXT,
  research_date DATE,
  researcher_name TEXT
);

CREATE TABLE AIAnalysis (
  analysis_id INT PRIMARY KEY,
  research_id INT,
  analysis_date DATE,
  trends_predicted TEXT
);

CREATE TABLE CustomerFeedback (
    id INT PRIMARY KEY,
    customer_id INT,
    feedback_date DATE,
    feedback_text TEXT
);

CREATE TABLE MarketTrendsAnalysis (
    id INT PRIMARY KEY,
    trend_id INT,
    trend_analysis TEXT
);

CREATE TABLE CustomerSatisfaction (
    id INT PRIMARY KEY,
    customer_id INT,
    satisfaction_score INT
);

CREATE TABLE AIModelData (
    id INT PRIMARY KEY,
    model_id INT,
    data_id INT,
    data_details JSON
);
